// src/labelVideoMapping.js
const labelVideoMapping = {
  0: {
    name: "Sit",
    video: "/videos/sit.mp4",
  },
  1: {
    name: "Forward Bend",
    video: "/videos/forward_bend.mp4",
  },
  2: {
    name: "Warrior Pose",
    video: "/videos/warrior_pose.mp4",
  },
  3: {
    name: "Triangle Pose",
    video: "/videos/triangle_pose.mp4",
  },
  4: {
    name: "Vajrasan",
    video: "/videos/vajrasan.mp4",
  },
  5: {
    name: "Backward Bend Pose",
    video: "/videos/backward_bend_pose.mp4",
  },
};

export default labelVideoMapping;
